import NavBar from '../components/NavBar'

const FrontPage = () => {

    return (
        <div >
            <NavBar/>   
            <div class="bg-{process.env.PUBLIC_URL + '/border.png'}">
            
            </div>
            <img className="h-10 repeat" src={process.env.PUBLIC_URL + '/border.png'} alt=""/>
        </div>
        
   
    );
}

export default FrontPage
